import React from 'react';
import './index.css';

const BottomNav = ({ onIncDec }) => {

    return (
        <nav className={`navbar navbar-light shadow-lg fixed-bottom navbar-bottom`}>
            <div className='container'>
                <button type='button' className='ml-20 btn btn-pat-auth-filled' onClick={() => onIncDec('back')}>Go Back</button>
                <button type='button' className='mr-20 btn btn-pat-auth-hollow' onClick={() => onIncDec('next')}>Next</button>
            </div>
        </nav>
    )
}

export default BottomNav;
